import ExpenseItem from "./ExpenseItem"
import './Expenses.css'
import Card from "../UI/Card";
import React from "react";


export default  Expenses = ({ expenses }) => {
  return (
    <Card className="expenses">
      {expenses.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}
    </Card>
  );
}
